import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path = "/" exact></Route>
        </Switch>
        <TextEditor />
      </Router>
    </>
  );
}

export default App;
